INSERT INTO `m_lib_graph_bargraph` (`graph_id`, `module_id`, `graph_sql`, `graph_title`, `graph_orientation`, `graph_xlabel`, `graph_ylabel`, `graph_barcolor`, `graph_flag`, `graph_height`, `graph_width`) VALUES
(1, 'notifiable_report', 'SELECT l.disease_name, count(l.disease_id)\r\nFROM m_consult_disease_notifiable c, m_lib_disease_notifiable l\r\nWHERE l.disease_id = c.disease_id\r\nGROUP BY c.disease_id', 'NOTIFIABLE DISEASES', 'H', 'NUMBER OF CONSULTS', 'Y', 'orange', '', 300, 300);
INSERT INTO `m_lib_graph_linegraph` (`graph_id`, `module_id`, `graph_sql`, `graph_title`, `graph_type`, `graph_xlabel`, `graph_y1label`, `graph_y2label`, `graph_barcolor`, `graph_flag`, `graph_height`, `graph_width`) VALUES
(1, 'consult_report', 'SELECT week(consult_date), round(avg(elapsed_time),1), count(consult_id)\r\nFROM `m_consult` group by week(consult_date)', 'CONSULT TIMES', '2PL', 'WEEK', 'CONSULT TIME, HRS', 'CONSULTS', 'orange', '', 300, 350);
INSERT INTO `m_lib_graph_piegraph` (`graph_id`, `module_id`, `graph_sql`, `graph_title`, `graph_flag`, `graph_height`, `graph_width`) VALUES
(1, 'consult_report', 'select p.patient_gender, count(p.patient_gender) from m_consult c, m_patient p where c.patient_id = p.patient_id group by p.patient_gender', 'CONSULT GENDER DISTRIBUTION', 'D', 300, 300),
(2, 'notifiable_report', 'SELECT l.disease_name, count(l.disease_id)\r\nFROM m_consult_disease_notifiable c, m_lib_disease_notifiable l\r\nWHERE l.disease_id = c.disease_id\r\nGROUP BY c.disease_id', 'NOTIFIABLE DISEASES', 'M', 400, 400);
