INSERT INTO `m_lib_notes_template` (`template_id`, `template_cat`, `template_name`, `template_text`) VALUES
(1, 'HX', 'Pedia History Present Illness', '___ days PTC- '),
(2, 'TX', 'Pneumonia', 'Cotrimoxazole BID X 5 days\r\nAmoxicillin TID X 5 days\r\nIncrease oral fluids\r\nContinue Breastfeeding\r\nMay give Tamarind, Calamansi or ginger for cough\r\nWOF: chest indrawing, stridor intractable vomiting,convulsions,unable to drink or breastfeed,difficult to awaken, abnormally sleepy\r\nFollow up in 2 days'),
(3, 'HX', 'Adult ROS', 'GA:\r\n(+) weight loss\r\n(+) easy fatiguability\r\n(+) fever\r\nSkin\r\n(+) rashes\r\n(+) itchiness\r\n(+) dryness of skin\r\nHead\r\n(+) headache\r\nEyes\r\n(+) BOV\r\n(+) eye redness\r\n(+) double vision\r\nEars\r\n(+) hearing loss\r\n(+) dizziness\r\n(+) tinnitus\r\n(+) ear ache\r\n(+) ear discharge\r\nNose and Sinuses\r\n(+) frequent colds\r\n(+) nasal stuffiness\r\n(+) nasal discharge\r\n(+) nosebleed\r\nMouth and Throat\r\n(+) bleeding gums\r\n(+) sore throat\r\n(+) hoarseness\r\n(+) anterior neck mass\r\nBreast\r\n(+) breast lumps\r\n(+) nipple discharge\r\nRespiratory\r\n(+) cough\r\n(+) hemoptysis\r\n(+) wheezing\r\n(+) chest tightness\r\n(+) DOB\r\n(+) orthopnea\r\nCardiac\r\n(+) palpitations\r\n(+) PND\r\n(+) dyspnea\r\n(+) chest pain\r\n(+) edema\r\nGIT\r\n(+) dysphagia\r\n(+) odynophagia\r\n(+) loss of appetite\r\n(+) vomiting\r\n(+) nausea\r\n(+) indigestion\r\n(+) burping\r\n(+) bloatedness\r\n(+) change in stool caliber\r\n(+) hematochezia\r\n(+) hematemesis\r\n(+) LBM\r\n(+) constipation\r\n(+) abdominal pain\r\n(+) Jaundice\r\nUrinary\r\n(+) frequency\r\n(+) polyuria\r\n(+) nocturia\r\n(+) dysuria\r\n(+) hematuria\r\n(+) hesitancy\r\n(+) dribbling\r\n(+) incontinence\r\n(+) decreased force of urine\r\nGenital\r\n(+) bulging hernia\r\n(+) penile discharge\r\n(+) testicular pain\r\n(+) vaginal itchiness\r\n(+) vaginal discharge\r\nVascular\r\n(+) intermittent claudication\r\n(+) leg cramps\r\n(+) varicosities\r\nMusculoskeletal\r\n(+) muscle or joint pain\r\n(+) joint swelling\r\n(+) joint redness\r\n(+) joint stiffness\r\n(+) limitation of movement\r\nNeuro\r\n(+) fainting\r\n(+) seizures\r\n(+) weakness\r\n(+) paralysis\r\n(+) numbness\r\n(+) tingling\r\n(+) tremors\r\nHema\r\n(+) anemia\r\n(+) pallor\r\n(+) easy bruisability\r\nEndo\r\n(+) heat, cold intolerance\r\n(+) excessive sweating\r\n(+) exophthalmos\r\n(+) polydipsia\r\n(+) polyphagia\r\nPsychiatric\r\n(+) nervousness\r\n(+) tension\r\n(+) depression\r\n(+) suicidal ideation\r\n(+) agitation\r\n(+) sleep difficulty\r\n\r\n'),
(7, 'HX', 'Adult Past Hx', 'PAST HISTORY-\r\nDM-\r\nThyroid-\r\nIHD-\r\nKidney -\r\nUTI -\r\nCVD-\r\nCancer-\r\nHPN-\r\nAsthma-\r\nPTB-\r\nPneumonia\r\nCOPD-\r\nAllergies-'),
(8, 'HX', 'Adult P/S Hx', 'PERSONAL/SOCIAL HISTORY\r\nOccupation-\r\nSmoking -\r\nAlcohol intake- \r\nDrug abuse-\r\nLiving condition-'),
(9, 'HX', 'Adult Family Hx', 'FAMILY HISTORY\r\nDM-\r\nThyroid-\r\nIHD-\r\nKidney -\r\nUTI -\r\nCVD-\r\nCancer-\r\nHPN-\r\nAsthma-\r\nPTB-\r\nPneumonia\r\nCOPD-\r\nArthritis-\r\nAllergies-\r\n\r\n'),
(10, 'HX', 'Adult Present Illness Hx', '___ days PTC'),
(11, 'PE', 'Ophtha Exam', 'Eyebrow- (-) scaling, (-) flakes\r\nEyelash- (-) matting\r\nEyelid- (-) ptosis, (-) swelling, (-) abscess\r\nConjunctiva- pink\r\nSclera- anicteric, \r\nCornea- clear\r\nAnterior chamber- deep\r\nIris- brown\r\nPupils- 2 mm EBRTL\r\nLens- clear\r\nEOM\\''s- full\r\nTonometry- firm\r\nFundoscopy: (+) ROR,CM, DDB, CDR 0.3, AV 2:3, (-) Hge, (-) Exudate\r\nVA: 6/6\r\n '),
(12, 'PE', 'ENT exam', 'Ear- (-) auricular pain, intact tympanic membrane\r\nNose and Sinuses- (-) swollen turbinates, (-) discharge, (-) tenderness on palpation\r\nMouth/Pharynx- (-)sores, (-) TPC, (-)dental caries, (-) cyanosis, midline uvula\r\nNeck- (-) anterior neck mass, (-) tenderness, (-) CLAD, midline trachea '),
(13, 'PE', 'Psychiatric Exam', 'MSE: oriented to all 3 spheres\r\nGA: young looking, well groomed, cooperative, good eye contact\r\nMOOD & AFFECT: euthymic mood, appropriate affect\r\nSPEECH: audible, spontaneous, (-) stutter\r\nPERCEPT. DIST.: (-) hallucination, (-) illusion, (-) flight of ideas\r\nTHOUGHT PROCESS: (-) circumstantiality,(-) tangentiality\r\nTHOUGHT CONTENT: (-) delusion, (-) suicidal ideation\r\nMEMORY: intact remote,recent, recent past and immediate\r\nCONCENTRATION: good\r\nATTENTION SPAN: good\r\nIMPULSE CONTROL: good\r\nINSIGHT: aware of his condition'),
(14, 'PE', 'Adult General Exam', 'GA: awake, ambulatory, NICRD\r\nVS: BP:           HR:          RR:            T:        BMI:\r\nENT: anicteric sclera, pink conj.,(-) TPC, (-) CLAD, (-) NVE, (-) ant neck mass, (-) discharge\r\nC/L: ECE,CBS, (-) rales, wheezes\r\nCVS: DHS, NRRR, (-) Murmurs, PMI 5th ICS LMCL     \r\nABD: Flabby, NABS, nontender, (-) hepatosplenomegaly\r\nExt: pink nailbeds, (-) edema, (-) cyanosis\r\nDRE: good sphincter tone, intact rectal vault, nontender, (-) blood, (+) brown feces on examining finger '),
(15, 'PE', 'Gyne Exam', 'Abdomen: flabby, nontender\r\n\r\nInternal Exam:\r\nExt Genitalia: normal gross looking\r\nVagina: multiparous\r\nCervix: closed, uneffaced\r\nUterus: nontender, not enlarged\r\nAdnexa: (-) mass, (-) tenderness\r\n\r\nSpeculum Exam: (-) discharge,(-)mass'),
(17, 'HX', 'Pedia Birth/ Feeding /Immunization Hx', 'Prenatal- (-) maternal illness, (+) regular consult, (-) alcohol intake,(-) drug use, (-)vaginal bleed\r\nNatal- born Full term via NSVD, Birth weight:    kg, Apgar:  \r\nNeonatal- (-) cyanosis, (-) jaundice, (-) infections\r\nFeeding History\r\nBreastfeeding- on demand up to __ months\r\nArtificial feeding- started on solid foods at __ months\r\nEating Habits- more on meat and vegetables\r\nImmunization History;\r\n(+) DPT\r\n(+)BCG\r\n(+)OPV\r\n(+)HepaB\r\n(+)MMR\r\nOthers:\r\n'),
(18, 'HX', 'Pedia Devtal Hx', 'Regard: 1 month\r\nTurn head: 3 months\r\nSit with support: 6 months\r\nSits alone: 9months\r\nCrawl: 9 months\r\nStands with support: 11 months\r\nStands alone: 12 months\r\nWalk: 13 months\r\nRun: 2 years\r\nToilet trained: 2.5 years\r\nWalks up and downstairs: 4 years\r\nCount to ten: 5 years\r\nWrites the alphabet: 5 years\r\n\r\n'),
(20, 'TX', 'Pharmacologic  Tx', 'Give Amoxicillin TID X 1 week\r\nGive Cotrimoxazole BID X 1 week\r\nGive Albendazole BID X 3 days\r\nGive FeSO4 TID\r\nGive Multivitamins OD\r\nGive Paracetamol q4 for Temp of >37.8\r\nGive Mefenamic acid TID\r\nGive Nifedipine  OD\r\nGive Cloxacillin QID X 1 week\r\nGive Dicycloverine TID\r\nGive Budesonide BID\r\n'),
(23, 'TX', 'Severe Pneumonia/Very Severe Disease', 'Cotrimoxazole BID X 5 days\r\nAmoxicillin  TID X 5 days\r\nGentamicin  IM OD\r\nBenzylpenicillin IM q6\r\nVitamin A IU X 1 dose\r\nBreastfeed the child\r\nGive expressed breastfeed or milk substitute at____ dilution\r\nSugar water 30-50ml of milk or sugar water\r\nGive 50ml milk or sugar water by NGT\r\nFor referral to  Hospital of choice '),
(24, 'TX', 'No Pneumonia: Cough or Cold', 'May give Tamarind, Ginger or Calamansi\r\nWOF: fast breathing, chest indrawing, stridor, convulsions, intractable vomiting, unable to feed, abnormally sleepy or difficulty awaking\r\nFf-up in 5 days if not improving'),
(25, 'PE', 'Neuro Exam', 'GS: awake, coherent oriented to all 3 spheres\r\nI: can smell\r\nII,III: 2-3 mm EBRTL\r\nIII,IV,VI: full EOM''s\r\nV: brisk corneals, good masseter tone\r\nVII: (-) facial asymmetry\r\nVIII: intact gross hearing\r\nIX,X: midline uvula, (+) gag\r\nXI: can shrug shoulders\r\nXII: midline tongue\r\n\r\nMotors: 5/5all extremities\r\nSensory: 100% intact all extremities\r\nDTR''s: +2 all extremities\r\nMeninges: supple neck\r\nBabinski: absent\r\nClonus: Absent\r\nCerebellar: can do FTNT, normal gait'),
(26, 'TX', 'Severe Dehydration', 'Start on IV fluid: ___ml pLRS X ___ hr\r\nMay give ORS ____ ml once patient can drink\r\nFor referral to hospital of choice '),
(27, 'TX', 'Some Dehydration', 'Give ___ml ORS in the first 4 hrs\r\nIf the child wants more, give more ORS\r\nFrequent small sips\r\nIf with vomiting, wait for 10 minutes then continue but more slowly\r\nGive extra fluids and continue giving until diarhea stops\r\nWOF: drinking poorly, blood in stool\r\nFollow up after __ days'),
(28, 'TX', 'Persistent Diarrhea', 'Give more frequent longer breastfeedings'),
(29, 'TX', 'Dysentery', 'Cotrimoxazole BID X 5 days\r\nGive ml ORS \r\nIf the child wants more, give more ORS\r\nFrequent small sips\r\nIf with vomiting, wait for 10 minutes then continue but more slowly\r\nGive extra fluids and continue giving until diarhea stops\r\nFollow up after 2 days'),
(30, 'TX', 'Mastoiditis', 'Cotrimoxazole BID X 5 days\r\nParacetamol  every 4 hrs\r\nFor referral to hospital of choice'),
(31, 'TX', 'Acute Ear infection', 'Cotrimoxazole BID X 5 days\r\nAmoxicillin TID X 5 days\r\nParacetamol every 4 hrs\r\nDry the ear by wicking  3X a day\r\nFollow up after 5 days'),
(32, 'TX', 'Chronic Ear Infection', 'Dry the ear by wicking 3 X a day\r\nFollow up in 5 days'),
(34, 'TX', 'Anemia or Very Low Weight', '-Vitamin A IU PO\r\n-Give Iron/Folate  OD X 2 weeks\r\n-Give Mebendazole 500 mg as a single dose\r\n-Give Albendazole 400 mg as a single dose\r\n-Breastfeed as often as the child wants\r\n-Give small amounts of porridge with added oil,mashed vegetables or beans,steamed tokwa,flaked fish,pulverized roasted dilis,finely ground meat,eggyolk,mashed ripe friuts 1 to 2 times per day after breastfeeding (4-6 months)\r\n-Give adequate amount of porridge with added oil, mashed vegetables or beans, steamed tokwa, flaked fish,pulverized roasted dilis, finely ground meat, eggyolk,bite sized friuts 3X a day if breastfed, 5 times a day if not breastfed ( 6-12 months)\r\n-Give adequate amount of rice, camote, potato, fish, chicken, meat, monggo, steamed tokwa, pulverized roasted dilis,milk and eggs,dark green leafy and yellow vegetables,fruits 5 times per day (12-24 months)\r\n- Give adequate amount of rice, camote, potato, fish, chicken, meat, monggo, steamed tokwa, pulverized roasted dilis,milk and eggs,dark green leafy and yellow vegetables,fruits 3 times per day ( 2 years over)\r\n-May give in between meals of boiled yellow camote,boiled yellow corn, peanuts, boiled saba banana, taho, fruits and fruit juice ( 2 years over)\r\n-Follow up in 2 weeks\r\n-Follow up in 30 days'),
(35, 'TX', 'Very Severe Febrile Disease/Malaria', 'Blood smear\r\nQuinine______ IM now\r\nCotrimoxazole_______BID X 5 days\r\nAmoxicillin_______ TID X 5 days\r\nParacetamol _______ now\r\nMay breastfeed the child\r\nMay give sugar water ___ ml now\r\nFor referral to hospital of choice\r\n'),
(38, 'TX', 'Severe Complicated Measles', 'Vitamin A IU X 1 dose\r\nTetracycline ointment  now\r\nFor referral to hospital of choice\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n'),
(39, 'TX', 'Measles with eye or mouth complications', 'Vitamin A _________ IU X 1 dose\r\nTetracycline ointment TID until redness is gone\r\nGentian violet BID\r\nFollow up in 2 days\r\n'),
(40, 'TX', 'Measles', 'Vitamin A _________ IU X 1 dose '),
(41, 'TX', 'Severe Dengue Hemorrhagic Fever', 'Start on IV fluid: ___ml pLRS X ___ hr\r\nMay give ORS ____ ml once patient can drink\r\nMay breastfeed or sugar water_____ ml\r\nFor referral to hospital of choice '),
(42, 'TX', 'Fever: Dengue Hemorrhagic fever unlikely', 'Paracetamol    mg/  ml  ml every 4-6 hours\r\nTepid Sponge Bath\r\nWOF: black vomitus, abdominal pain, skin petechiae               \r\nFollow up in 2 days if fever persists or child show signs of bleeding'),
(43, 'PE', 'Pedia General Exam', 'GA: awake, fairly developed, fairly nourished\r\nVS:  Ht:                 Wt:  kg    HC:  cm\r\n        BP:                HR:         RR:            T: \r\nHEENT: closed ant fontanelle, anicteric sclera, pink conjunctiva, (-) ear discharge, (-) tragal tenderness, patent nasal passages, (-) TPC, (-) CLAD\r\nC/L: ECE, CBS, (-) rales, wheezes\r\nCVS: DHS, NR,RR, (-) murmur\r\nABD: protuberant, NABS, nontender, (-) hepatosplenomegaly\r\nEXT: (-) edema, (-) cyanosis \r\n'),
(44, 'HX', 'Pedia ROS', 'GA:\r\n(+) weight loss\r\n(+) easy fatiguability\r\n(+) fever\r\nSkin\r\n(+) rashes\r\n(+) itchiness\r\n(+) dryness of skin\r\nHead\r\n(+) headache\r\nEyes\r\n(+) BOV\r\n(+) eye redness\r\n(+) double vision\r\nEars\r\n(+) hearing loss\r\n(+) dizziness\r\n(+) ear ache\r\n(+) ear discharge\r\nNose and Sinuses\r\n(+) frequent colds\r\n(+) nasal stuffiness\r\n(+) nasal discharge\r\n(+) nosebleed\r\nMouth and Throat\r\n(+) bleeding gums\r\n(+) sore throat\r\n(+) hoarseness\r\n(+) anterior neck mass\r\nBreast\r\n(+) breast lumps\r\n(+) nipple discharge\r\nRespiratory\r\n(+) cough\r\n(+) hemoptysis\r\n(+) wheezing\r\n(+) chest tightness\r\n(+) DOB\r\n(+) orthopnea\r\nCardiac\r\n(+) palpitations\r\n(+) PND\r\n(+) dyspnea\r\n(+) chest pain\r\nGIT\r\n(+) dysphagia\r\n(+) odynophagia\r\n(+) loss of appetite\r\n(+) indigestion\r\n(+) burping\r\n(+) bloatedness\r\n(+) change in stool caliber\r\n(+) hematochezia\r\n(+) hematemesis\r\n(+) LBM\r\n(+) constipation\r\n(+) abdominal pain\r\n(+) Jaundice\r\nUrinary\r\n(+) frequency\r\n(+) polyuria\r\n(+) nocturia\r\n(+) dysuria\r\n(+) hematuria\r\n(+) hesitancy\r\n(+) dribbling\r\n(+) incontinence\r\n(+) decreased force of urine\r\nGenital\r\n(+) bulging hernia\r\n(+) penile discharge\r\n(+) testicular pain\r\n(+) vaginal itchiness\r\n(+) vaginal discharge\r\nVascular\r\n(+) intermittent claudication\r\n(+) leg cramps\r\n(+) varicosities\r\nMusculoskeletal\r\n(+) muscle or joint pain\r\n(+) joint swelling\r\n(+) joint redness\r\n(+) joint stiffness\r\n(+) limitation of movement\r\nNeuro\r\n(+) fainting\r\n(+) seizures\r\n(+) weakness\r\n(+) paralysis\r\n(+) numbness\r\n(+) tingling\r\n(+) tremors\r\nHema\r\n(+) anemia\r\n(+) pallor\r\n(+) easy bruisability\r\nEndo\r\n(+) heat, cold intolerance\r\n(+) excessive sweating\r\n(+) exophthalmos\r\n(+) polydipsia\r\n(+) polyphagia\r\nPsychiatric\r\n(+) nervousness\r\n(+) tension\r\n(+) depression\r\n(+) suicidal ideation\r\n(+) agitation\r\n(+) sleep difficulty\r\n'),
(45, 'TX', 'Mouth Ulcers', 'Treat mouth ulcers twice daily.\r\n- wash hands\r\n- wash child''s mouth with cleas soft cloth wrapped around the finger and wet with salt water\r\n- paint the mouth with half-strength gentian violet\r\n- wash hands again'),
(46, 'TX', 'No Dehydration', 'Give extra fluids (such as soups, rice water, buko juice)\r\n< 2 y/o:50-100 ml after each loose stool\r\n> 2y/o: 100-200 ml after each loose stool\r\nIf child vomits, wait 10 minutes\r\nContinue breastfeeding, feeding\r\nReturn immediately: blood in stool, drinks poorly\r\nFf-up in 5 days if not improving\r\n'),
(47, 'TX', 'ATP', 'Amoxicillin  TID x 7 days\r\nCefalexin   TID x 7 days\r\nIncrease oral fluids\r\nWarm saline gargle\r\nff-up after 5 days'),
(48, 'TX', 'Hypertension', 'Dxtics: FBS,K,Crea, TC,LDL\r\n             ECG, Urinalysis\r\nMetoprolol 50 mg BID\r\nASA 80 mg OD\r\nLow salt low fat diet\r\nExercise daily\r\nDaily BP monitoring\r\n'),
(49, 'TX', 'Congestive Heart Failure', 'Dxtics: CBC, Na,K,FBS,Crea, ECG\r\n              2D ECHO w doppler\r\nTxtics:  Furosemide 40 mg BID\r\n             Imidapril 5 mg OD\r\n             Lanoxin 0.25 mg OD\r\nLimit Total Fluid Intake to 1.2L/day\r\nLow salt low fat diet \r\n'),
(50, 'TX', 'Bronchial Asthma', 'Dxtics: Pulmonary Function Test\r\nTx: Salbutamol 2mg tab TID PRN    or\r\n       Salbutamol rotahaler PRN\r\n       Theophylline 300 mg tab OD\r\n       Fluticasone MDI 125mg 2 puffs BID \r\n       \r\n       \r\n        '),
(51, 'TX', 'Hypersensitivity Reaction', 'Diphenhydramine 1 amp IM now\r\nDiphenhydramine 25-50 mg TID X 5 days\r\nAvoid triggers\r\nWOF: DOB, pallor, persistent dizziness'),
(52, 'TX', 'UTI', 'Amoxicillin  q8 x 7 days\r\nCOTMX  BID x 7 days\r\nIncrease Oral Fluids\r\nRepeat Urinalysis after 1 week'),
(53, 'TX', 'Diabetes Mellitus', 'Dxtics: FBS, HBA1c,Urinalysis, TC,LDL, ECG\r\nTxtics:  Glibenclamide 5 mg OD pre meals\r\n            Metformin 500 mg TID after meals\r\n            Acarbose 50 mg TID on first first chew\r\nExercise daily\r\nLow fat, low carbohydrate diet, avoid simple sugars\r\n            \r\n\r\n'),
(54, 'TX', 'Community Acquired Pneumonia I', 'Dxtics: CXR PA ( optional)\r\nAmoxicillin 500 mg TID X 1 week\r\nCotrimoxazole 800/160 mg BID X 1 week\r\n');
